import React from 'react';
import { Link } from 'react-router-dom'; // Import Link component from React Router
import './WelcomePage.css'; // Import CSS file for styling

function WelcomePage() {
  return (
    <div className="welcome-container">
      <h2>Welcome, Ana!</h2>
      <p>You are now logged in.</p>
      <div className="button-container">
        <Link to="/update-schedule" className="button">Update Your Schedule</Link>
        <Link to="/suggested-links" className="button">Suggested Links</Link>
        <Link to="/add-contacts" className="button">Add Contacts</Link>
      </div>
    </div>
  );
}

export default WelcomePage;
